const Cards = ({ movie }) => {
  return (
    <div className="cards">
      <div className="img-container">
        <img src="./img/M.png" alt="" className="logo" />
        <img
          src={
            movie.poster_path
              ? "https://image.tmdb.org/t/p/original" + movie.poster_path
              : "./img/poster.jpg"
          }
          alt={movie.poster_path}
          className="img-card"
        />
        <p className="type">{movie.media_type}</p>
      </div>
    </div>
  );
};

export default Cards;
